query:
DELETE FROM planes_sucesion
WHERE id IN (
  SELECT id FROM (
    SELECT id, ROW_NUMBER() OVER (PARTITION BY planSustitucionId ORDER BY id DESC) as rn
    FROM planes_sucesion
    WHERE planSustitucionId IN (
      SELECT planSustitucionId FROM planes_sucesion GROUP BY planSustitucionId HAVING COUNT(*) > 1
    )
  ) t
  WHERE rn > 1
);

